#include <math.h>
#include <stdio.h>

struct interval
{
    int no;
    int start;
    int end;
    int status;
};

int main()
{
    int right_end, obstacle_num, pay = 1; // obstacle => 障碍
    scanf("%d %d", &right_end, &obstacle_num);
    struct interval list[obstacle_num];
    list[0].start = 0;
    for (int i = 0; i < obstacle_num; i++)
    {
        list[i].no = i + 1;
        list[i].status = 1;
        scanf("%d", &list[i].end);
        list[i + 1].start = list[i].end;
    }

    /*for (int j = 0; j < obstacle_num; j++)
    {
        printf("s %d, e %d\n", list[j].start, list[j].end);
    } */

    int last_result_value = 0;
    while (1)
    {
        int max_diff = 0;
        int max_get_no;
        int max_length = 0;
        int result;
        for (int k = 1; k < obstacle_num; k++)
        {
            int diff = list[k].end - list[k - 1].end;
            if (diff > max_diff)
            {
                max_diff = diff;
                max_get_no = list[k - 1].no;
            }
        }
        max_length = list[max_get_no].end - list[max_get_no - 1].start;
        result = max_length - pay * pay;
        pay++;
        if (result < last_result_value)
        {
            break;
        }
        last_result_value = result;
    }

    printf("%d\n", last_result_value);
}

